import React from 'react';
import './SocialMedia.css'; // Add a CSS file for custom styling

const socialMediaLinks = [
    { name: 'LinkedIn', url: 'https://www.linkedin.com/in/aruj-punia-024a5323a/', icon: '🔗', color: '#0077B5' },
    { name: 'GitHub', url: 'https://github.com/puniaruj', icon: '🐙', color: '#333' },
    { name: 'LeetCode', url: 'https://leetcode.com/u/ArujPunia/', icon: '🧮', color: '#FFA116' },
    { name: 'Stack Overflow', url: 'https://stackoverflow.com/users/29086886/aruj-punia', icon: '💻', color: '#F48024' },
    { name: 'Spotify', url: 'https://open.spotify.com/user/7mgniraw79hqa3lpeiwlkimqq?si=c1507a9a402045e5', icon: '🎵', color: '#1DB954' },
    { name: 'Instagram', url: 'https://www.instagram.com/arujpunia/', icon: '📸', color: '#C13584' },
    { name: 'Snapchat', url: 'https://www.snapchat.com/add/aruj_punia21?share_id=izljs_P3Qbc&locale=en-US', icon: '👻', color: '#FFFC00' },
    { name: 'Discord', url: 'https://discord.com/user/', icon: '🎮', color: '#5865F2' },
    { name: 'Steam', url: 'https://store.steampowered.com', icon: '🎲', color: '#171A21' },
    { name: 'Epic Games', url: 'https://www.epicgames.com', icon: '🎮', color: '#313131' },
    { name: 'YouTube', url: 'https://youtube.com', icon: '🎥', color: '#FF0000' },
    { name: 'Riot Games', url: 'https://www.riotgames.com', icon: '🎮', color: '#D13639' },
];

const SocialMedia = () => {
    return (
        <div className="social-media-grid">
            {socialMediaLinks.map((social, index) => (
                <div
                    key={index}
                    className="social-card"
                    style={{ boxShadow: `0px 4px 10px ${social.color}` }}
                >
                    <a href={social.url} target="_blank" rel="noopener noreferrer">
                        <div className="social-icon" style={{ color: social.color }}>
                            {social.icon}
                        </div>
                        <h3>{social.name}</h3>
                    </a>
                </div>
            ))}
        </div>
    );
};

export default SocialMedia;
